import React, { Fragment } from "react";
import { Content } from "../Components/Content";

function LecturerCourseDetail() {
    return (
        <Fragment>
            <Content>
                <div id="lecturerCourseDetail" style={{ padding: "2rem" }}>
                    <div className="courseSection" style={{ width: "70%" }}>
                        <h3 className="my-4" style={{ fontWeight: "600" }}>My Courses</h3>
                    </div>
                </div>
            </Content>
        </Fragment>
    );
}
export default LecturerCourseDetail;
